// Helper functions
export function getReserveBySymbol(symbol: string): MarketReserve | undefined {
  return SUILEND_RESERVES.find(
    (r) => r.symbol.toLowerCase() === symbol.toLowerCase()
  );
}

export function getReserveByCoinType(
  coinType: string
): MarketReserve | undefined {
  const normalized = coinType.toLowerCase();
  return SUILEND_RESERVES.find((r) => r.coinType.toLowerCase() === normalized);
}

